import React from 'react';
import { pupData } from './pupData';

//props is our backpack to put our pupcard into 
const PupCard = (props) => {
    //put pup data into our backpack
    //may need to define single pup for mapping through all the puppies
    const {pupData} = props;

    return(

    <div className="single-player-card">
          <div className="header-info">
            <p className="pup-title">{pupData[0].name}</p>
            <p className="pup-number">#{pupData[0].id}</p>
          </div>
          <img src={pupData[0].imageUrl} />
          <button className="detail-button" data-id={pupData[0].id}>See details</button>
          <button className="delete-button" data-id={pupData[0].id}>Remove from roster</button>
    </div>


    );
};

export default PupCard;
